import React from "react";
import { useNavigate } from "react-router-dom";


function LoginType() {
    const navigate = useNavigate();

    return (
        <div>
            <h1>GİRİŞ TÜRÜNÜ SEÇİNİZ</h1>
            <button onClick={() => navigate("/Login", { state: { role: "admin" } })}>Admin Giriş</button>
            <button onClick={() => navigate("/Login", { state: { role: "kullanici" } })}>Kullanıcı giriş</button>
        </div>
    )
}
